let scaleFactor = 1;
let currentRate = 0;

let currentPosition = new THREE.Vector3();

let currentTime = 0;

function Crow (app) {
  THREE.Object3D.call(this);

  this.name = 'crow';

  const geometry = new THREE.BoxGeometry(3,1.5,1);
  geometry.translate(1,0,0)
  const material   = new THREE.MeshBasicMaterial( { color: 0xff0000, transparent:true, opacity:0} );

  this.mesh = new THREE.Mesh(geometry,material);
  this.add(this.mesh);
  this.mesh.name = 'crowMesh';
  this.app = app;

  this.app.emitter.on('updateVideoTime',this.updateVideoTime.bind(this));
}

Crow.prototype = Object.create(THREE.Object3D.prototype);

Crow.prototype.updateVideoTime = function (time) {
  this.videoTime = time;
}

Crow.prototype.addToRayController = function (controller) {
  var self = this;
  controller.add(this.mesh,{
    over: function(bool){
      // console.log('over',bool);
    },
    active: function(bool){
      // console.log('active',bool);
    }
  });
}

// https://stackoverflow.com/questions/28420724/how-to-determine-the-intended-frame-rate-on-an-html-video-element/28455790#28455790
Crow.prototype.update = function (dt, time) {
    currentRate = Math.round(this.videoTime * 60);
    const initialIndex = currentRate * 3;

    if (initialIndex + 2 < crowData.length) {
      currentPosition.x = crowData[initialIndex] / scaleFactor;
      currentPosition.y = crowData[initialIndex + 1] / scaleFactor;
      currentPosition.z = crowData[initialIndex + 2] / scaleFactor;
    }

    this.mesh.position.set(currentPosition.x,currentPosition.y,currentPosition.z);
    this.mesh.lookAt(this.app.camera.position);
}

module.exports = Crow;
